// * The function of adding a loader to the button

function addBtnLoader(btn) {
  btn.attr("disabled", "disabled").css("width", btn.outerWidth() + "px").css("height", btn.outerHeight() + "px").html('<div class="lds-ellipsis"><div></div><div></div><div></div><div></div></div>');
} // * The function of removing the loader from the button


function removeBtnLoader(btn, btnOld) {
  btn.removeAttr("disabled").removeAttr("style").html(btnOld);
} // * Вычисляет ширину полосы прокрутки при открытии модалки


function scrollWidth() {
  var div = document.createElement("div");
  div.style.height = "50px";
  div.style.width = "50px";
  div.style.overflowY = "scroll";
  document.body.appendChild(div);
  var scrollWidth = div.offsetWidth - div.clientWidth;
  div.remove();
  return scrollWidth;
} // * Убирает прокрутку у body


function bodyFixed() {
  $("body").css({
    "padding-right": scrollWidth() + "px",
    overflow: "hidden"
  });
}

function clearInlineStyle(element) {
  element.removeAttr("style");
}

$(".validate-field").on("input", function () {
  $(this).closest(".custom-input").removeClass("validate-error");
});
/* modals */

function showModal(modalParam) {
  var modal = $(".modal[data-modal=".concat(modalParam, "]"));
  var bg = $(".modals");

  if (bg.is(":visible")) {
    modal.fadeIn(300);
  } else {
    $(".modals").fadeIn(300);
    modal.fadeIn(300);
    bodyFixed();
  }

  modal.addClass("open"); // добавляет скролбар, если контент не помещается в модалку

  var modalHeight = modal.height();
  var modalContent = modal.find(".modal__overflow").height();

  if (modalContent > modalHeight) {
    modal.find(".modal__content").addClass("overflow");
  } else {
    modal.find(".modal__content").removeClass("overflow");
  }
}

function hideModal(modalParam) {
  var modal = $(".modal[data-modal=".concat(modalParam, "]"));
  $(".modals").fadeOut(300);
  modal.fadeOut(300).removeClass("open");
  clearInlineStyle($("body"));
}

function openSuccessModal() {
  showModal("thanks-modal");
}

$(".openmodal").on("click", function (e) {
  e.preventDefault();
  var modalId = $(this).attr("data-modal");
  showModal(modalId);
  var modal = $(this).closest(".modal");
  modal.attr("style", "display: none").removeClass("open");
});
$(".modal__close").on("click", function () {
  var form = $(this).closest(".modal").find("form");
  var element = $(this);
  var modal = element.closest(".modal").attr("data-modal");
  hideModal(modal);
});

