$("form").on("submit", function (e) {
  e.preventDefault();
  var form = $(this);
  var btn = form.find("button[type=submit]");
  var btnHtml = btn.html();
  var fd = new FormData(form[0]);
  var validateFields = false;
  var correct = 0;
  var fieldsCount = form.find(".validate-field").length;
  form.find(".validate-field").each(function () {
    var inputVal = $(this).val().toString().replace(/[^\d.]/g, "");

    if ($(this).attr("name") === "phone" && inputVal.length < 10) {
      correct--;
      $(this).closest(".custom-input").addClass("validate-error");
    }

    if (!$(this).val()) {
      $(this).closest(".custom-input").addClass("validate-error");
    } else {
      correct++;
    }

    if (correct === fieldsCount) {
      validateFields = true;
    }
  });

  if (validateFields) {
    form.find(".validate-field").closest(".custom-input").removeClass("validate-error");
    addBtnLoader(btn);
    ajaxPost("https://jsonplaceholder.typicode.com/users", fd).then(function (response) {
      return response.json();
    }).then(function (data) {
      form.get(0).reset();
      removeBtnLoader(btn, btnHtml);
      var modal = form.closest(".modal");
      modal.attr("style", "display: none").removeClass("open");
      openSuccessModal();
      clearCart();
    })["catch"](function (error) {
      return console.log(error);
    });
  }
}); // counter
// считает общую стоимость в корзине

function totalPrice() {
  var pricesArr = [];
  var price = $(document).find(".cart__item-price span");
  price.each(function () {
    var txt = $(this).text();
    pricesArr.push(txt);
  });
  var total = 0;
  $.each(pricesArr, function () {
    total += parseFloat(this) || 0;
  });
  $(".cart__total span").text(total.toLocaleString().replace(/,/g, " ") + " ₽");
  $(".order__total span").text(total.toLocaleString().replace(/,/g, " ") + " ₽");
}

$(document).ready(function () {
  totalPrice();
});
var counter = $(".counter");
counter.each(function () {
  var minusBtn = $(this).find(".counter__minus");
  var plusBtn = $(this).find(".counter__plus");
  var cartItem = $(this).closest(".cart__item");
  var priceForOne = Number(cartItem.attr("data-price")); // Убавляем кол-во по клику

  minusBtn.on("click", function () {
    var $input = $(this).parent().find(".counter__input");
    var count = parseInt($input.val()) - 1;
    count = count < 1 ? 1 : count;
    $input.val(count);

    if ($input.val() == 1) {
      minusBtn.addClass("disabled");
    } else {
      minusBtn.removeClass("disabled");
    }

    if ($input.val() < $input.data("max-count")) {
      plusBtn.removeClass("disabled");
    }

    priceChanging(cartItem, count, priceForOne);
    totalPrice();
    cartItemChanging(cartItem);
  }); // Прибавляем кол-во по клику

  plusBtn.on("click", function () {
    var $input = $(this).parent().find(".counter__input");
    var count = parseInt($input.val()) + 1;
    count = count > parseInt($input.data("max-count")) ? parseInt($input.data("max-count")) : count;
    $input.val(parseInt(count));

    if ($input.val() > 1) {
      minusBtn.removeClass("disabled");
    }

    if ($input.val() == $input.data("max-count")) {
      plusBtn.addClass("disabled");
    }

    priceChanging(cartItem, count, priceForOne);
    totalPrice();
    cartItemChanging(cartItem);
  });
}); // Убираем все лишнее и невозможное при изменении поля

$(".counter input").on("change keyup input click", function () {
  if (this.value.match(/[^0-9]/g)) {
    this.value = this.value.replace(/[^0-9]/g, "");
  }

  if (this.value == "") {
    this.value = 1;
  }

  if (this.value > parseInt($(this).data("max-count"))) {
    this.value = parseInt($(this).data("max-count"));
  }
});

function clearCart() {
  $(".cart__item").remove();
  $(".cart__table").append("<p class=\"cart-empty\">\u0412\u044B \u043D\u0438\u0447\u0435\u0433\u043E \u043D\u0435 \u0434\u043E\u0431\u0430\u0432\u0438\u043B\u0438 \u0432 \u043A\u043E\u0440\u0437\u0438\u043D\u0443</p>");
  $(".cart__total").hide();
  $(".primary-btn_order").hide();
  $(".primary-btn_catalog").attr("style", "display: block");
  $(".modal[data-modal=cart]").addClass("empty");
} // тянет данные в оформление при загрузке страницы


$(document).ready(function () {
  var cartItem = $(".cart__item");
  cartItem.each(function () {
    var cartItemId = $(this).attr("id");
    var cartItemTitle = $(this).find(".cart__item-name").text();
    var counterInputVal = $(this).find(".counter__input").val();
    var itemPrice = $(this).find(".cart__item-price").text();
    var cartTotal = $(".cart__total span").text().toLocaleString().replace(/,/g, " ");
    $(".order__data").append("<div class=\"order__item\" id=\"".concat(cartItemId, "\"><div class=\"order__item-title\">").concat(cartItemTitle, "</div><div class=\"order__item-amount\">").concat(counterInputVal, " \u0448\u0442.</div><div class=\"order__item-price\">").concat(itemPrice, "</div></div>"));
    $(".order__total span").text(cartTotal); // удаляет товар из корзины и из оформления заказа

    var itemDeleteBtn = $(this).find(".cart__item-delete");
    itemDeleteBtn.on("click", function () {
      $(this).closest(".cart__item").remove();
      $(".order__item[id=".concat(cartItemId, "]")).remove();

      if ($(".cart__item").length == 0) {
        clearCart();
      } else {
        $(".cart-empty").remove();
        $(".cart__total").show();
        $(".primary-btn_order").show();
        $(".primary-btn_catalog").hide();
      }

      totalPrice();
    });
  });
}); // следит за изменением значений количества и стоимости товаров

function cartItemChanging(item) {
  var itemId = item.attr("id");
  var itemAmount = item.find(".counter__input").val();
  var itemPrice = item.find(".cart__item-price").text();
  $(".order__item[id=".concat(itemId, "]")).find(".order__item-amount").text(itemAmount + " шт.");
  $(".order__item[id=".concat(itemId, "]")).find(".order__item-price").text(itemPrice);
} // умножает количество товара на его стоимость и записывает в поле в корзине


function priceChanging(cartItem, count, priceForOne) {
  cartItem.find(".cart__item-price span").text(count * priceForOne);
} // выбор кода телефона страны


